import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {FaLongArrowAltUp} from 'react-icons/fa'
import './App.css'

ReactDOM.render(
  <React.StrictMode>
    <App />
    <FaLongArrowAltUp className= 'up-arrow'/>
  </React.StrictMode>,
  document.getElementById('root')
);
